import React, { useContext, useState } from "react";
import { Link as RouterLink, useLocation } from "react-router-dom";
import {
  AppBar,
  Toolbar,
  Typography,
  Badge,
  IconButton,
  Box,
  Button,
  Container,
  Drawer,
  List,
  ListItem,
  ListItemText,
} from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import RestaurantMenuIcon from "@mui/icons-material/RestaurantMenu";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Close";
import { CartContext } from "../context/CartContext";

const Navbar = () => {
  const { cart = [] } = useContext(CartContext);
  const itemCount = cart.reduce((sum, item) => sum + (item.quantity || 1), 0);
  const location = useLocation();
  const [mobileOpen, setMobileOpen] = useState(false);

  const isActive = (path) => location.pathname === path;
  const toggleDrawer = () => setMobileOpen(!mobileOpen);

  const navLinks = [
    { label: "Home", path: "/" },
    { label: "Orders", path: "/orders" },
    { label: "Login", path: "/login" },
  ];

  return (
    <>
      <AppBar
        position="sticky"
        elevation={3}
        sx={{
          background: "linear-gradient(90deg, #2c3e50, #4ca1af)",
          color: "#fff",
        }}
      >
        <Container maxWidth="lg">
          <Toolbar disableGutters sx={{ display: "flex", justifyContent: "space-between" }}>
            {/* Left section */}
            <Box sx={{ display: "flex", alignItems: "center", gap: 1 }}>
              <RestaurantMenuIcon sx={{ fontSize: 30, color: "#ffcc00" }} />
              <Typography
                variant="h6"
                component={RouterLink}
                to="/"
                sx={{
                  textDecoration: "none",
                  color: "#fff",
                  fontWeight: 800,
                  letterSpacing: 1,
                  "&:hover": { color: "#ffcc00" },
                }}
              >
                Canteen
              </Typography>
            </Box>

            {/* Desktop Links */}
            <Box sx={{ display: { xs: "none", sm: "flex" }, gap: 2 }}>
              {navLinks.map((nav) => (
                <Button
                  key={nav.path}
                  component={RouterLink}
                  to={nav.path}
                  sx={{
                    color: isActive(nav.path) ? "#ffcc00" : "#fff",
                    fontWeight: isActive(nav.path) ? 700 : 500,
                    "&:hover": { color: "#ffcc00", transform: "translateY(-1px)" },
                    transition: "all 0.2s ease",
                  }}
                >
                  {nav.label}
                </Button>
              ))}
            </Box>

            {/* Cart + Menu */}
            <Box sx={{ display: "flex", alignItems: "center", gap: 1 }}>
              <IconButton component={RouterLink} to="/cart" color="inherit">
                <Badge badgeContent={itemCount} color="warning" overlap="circular">
                  <ShoppingCartIcon />
                </Badge>
              </IconButton>

              {/* Mobile Menu */}
              <IconButton
                color="inherit"
                sx={{ display: { xs: "block", sm: "none" } }}
                onClick={toggleDrawer}
              >
                <MenuIcon />
              </IconButton>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>

      {/* Drawer for mobile menu */}
      <Drawer anchor="right" open={mobileOpen} onClose={toggleDrawer}>
        <Box
          sx={{
            width: 220,
            background: "linear-gradient(180deg, #2c3e50, #4ca1af)",
            height: "100%",
            color: "white",
            p: 2,
          }}
        >
          <Box sx={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
            <Typography variant="h6">Menu</Typography>
            <IconButton onClick={toggleDrawer} sx={{ color: "white" }}>
              <CloseIcon />
            </IconButton>
          </Box>
          <List>
            {navLinks.map((nav) => (
              <ListItem
                button
                key={nav.path}
                component={RouterLink}
                to={nav.path}
                onClick={toggleDrawer}
                sx={{
                  borderRadius: 2,
                  mt: 1,
                  background: isActive(nav.path) ? "rgba(255, 255, 255, 0.15)" : "transparent",
                  "&:hover": { background: "rgba(255,255,255,0.2)" },
                }}
              >
                <ListItemText primary={nav.label} />
              </ListItem>
            ))}
          </List>
        </Box>
      </Drawer>
    </>
  );
};

export default Navbar;
